    return (
        <section className="booklist">
        <Book/>
        <Book/>
        <Book/>
        </section>
    )
}
const Book=() =>{
    return (
        <article className="book">
        <Image/>
        <Title/>
        <Author/>
        </article>
        )
}
const Image=() => <img src="https://images-na.ssl-images-amazon.com/images/I/91MowzF+WZL._AC_UL600_SR600,400_.jpg" alt="The Light We Carry: Overcoming in Uncertain Times"/>
const Title=() => <h2>The Light We Carry: Overcoming in Uncertain Times</h2>
const Author=() => {
    const inlineHeadingStyles={color:'#617d98',
    fontSize:'0.75rem',marginTop:"0.5rem" }
   return <h4 style={{color:'#617d98',fontSize:'0.75rem',marginTop:"0.5rem" }}>Michelle Obama</h4>
}


